INSERT INTO `tblappsettings` VALUES (1,1,1,12,11,5,5,'mypass',5,5,'Dear @borrower,\r\n\r\nThis is to confirm the return of the following books on @return_date:\r\n@borrowed_books\r\n\r\nThank you for returning them on time. We look forward to serving you again.\r\n\r\nBest regards,\r\nLibrarian: @librarian','Dear @borrower,\r\n\r\nThe following books borrowed on @borrow_date are overdue since @overdue_date:\r\n@borrowed_books\r\n\r\nKindly return them promptly.\r\n\r\nThank you,\r\nLibrarian: @librarian','Dear @borrower,\r\n\r\nYou borrowed the following books on @borrow_date, due by @overdue_date:\r\n@borrowed_books\r\n\r\nPlease return them on time.\r\n\r\nThank you,\r\nLibrarian: @librarian','jtenoriobscs@tfvc.edu.ph','Dear @borrower,\r\n\r\nThis is a friendly reminder that the following books borrowed on @borrow_date are due soon:\r\n@borrowed_books\r\n\r\nDue Date: @overdue_date\r\n\r\nPlease return them by the due date to avoid overdue fines.\r\n\r\nThank you,\r\nLibrarian: @librarian');
