CREATE DEFINER=`root`@`localhost` PROCEDURE `AddBookCopies`(
	IN number_of_copies INTEGER,
    IN bid INTEGER,
    IN pr FLOAT,
    IN did INT,
    IN sid INT
)
BEGIN
	DECLARE max_accession_number INT;
    DECLARE next_accession_number INT;
    DECLARE i INT DEFAULT 1;

    START TRANSACTION;
    WHILE i <= number_of_copies DO
		-- Get the highest accession number in the table
		SELECT IFNULL(MAX(CAST(accession_no AS UNSIGNED)), 0) INTO max_accession_number FROM tblbookcopies;
        
        SET next_accession_number = max_accession_number + 1;
        
        INSERT INTO tblbookcopies (book_id, accession_no, donator_id, supplier_id, price)
        VALUES (bid, LPAD(next_accession_number, 10, '0'), NULLIF(did, 0), NULLIF(sid, 0), pr);

        SET i = i + 1;
    END WHILE;
    COMMIT;
END ;;
